import React, { useState } from "react";
import {
  Form,
  FormGroup,
  Label,
  Input,
  Button,
  Container,
  Alert,
  Row,
  Col,
} from "reactstrap";
import { useNavigate } from "react-router-dom";
import img from '../Components/img3.JPG';
import logo from '../Components/lo.png';
import { useLanguage } from '../Store/LanguageContext';

const Feed = () => {
  const navigate = useNavigate();
  const { lang, t } = useLanguage();

  const [formData, setFormData] = useState({
    name: "",
    number: "",
    feedback: "",
    suggestions: "",
  });

  const [submitted, setSubmitted] = useState(false);
  const [error, setError] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // تحقق بسيط من إدخال البيانات
    if (!formData.name || !formData.number || !formData.feedback) {
      setError("Please fill all required fields.");
      return;
    }

    try {
      const response = await fetch("http://localhost:3001/api/feedbacks", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        setSubmitted(true);
        setError("");
        setFormData({
          name: "",
          number: "",
          feedback: "",
          suggestions: "",
        });

        // إعادة التوجيه بعد ثانيتين
        setTimeout(() => navigate("/"), 2000);
      } else {
        setError("Error sending feedback. Please try again.");
      }
    } catch (error) {
      console.error("Submission error:", error);
      setError("Error connecting to server.");
    }
  };

  return (
    <Container className="mt-4">
      <div style={{ display: "flex", alignItems: "center", justifyContent: "space-between" }}>
        <img src={logo} alt="Logo" style={{ width: "120px" }} />
      </div>

      <Row className="mt-4">
        <Col md={6}>
          <img src={img} alt="Event" style={{ width: "100%", borderRadius: "15px" }} />
        </Col>

        <Col md={6}>
          <h2>{t[lang].feedbackForm}</h2>

          {submitted && <Alert color="success">{t[lang].thankYou}</Alert>}
          {error && <Alert color="danger">{error}</Alert>}

          <Form onSubmit={handleSubmit}>
            <FormGroup>
              <Label for="name">{t[lang].name}</Label>
              <Input
                type="text"
                name="name"
                id="name"
                placeholder={t[lang].namePlaceholder}
                value={formData.name}
                onChange={handleChange}
              />
            </FormGroup>

            <FormGroup>
              <Label for="number">{t[lang].number}</Label>
              <Input
                type="text"
                name="number"
                id="number"
                placeholder={t[lang].numberPlaceholder}
                value={formData.number}
                onChange={handleChange}
              />
            </FormGroup>

            <FormGroup>
              <Label for="feedback">{t[lang].feedback}</Label>
              <Input
                type="textarea"
                name="feedback"
                id="feedback"
                placeholder={t[lang].feedbackPlaceholder}
                value={formData.feedback}
                onChange={handleChange}
              />
            </FormGroup>

            <FormGroup>
              <Label for="suggestions">{t[lang].suggestions}</Label>
              <Input
                type="textarea"
                name="suggestions"
                id="suggestions"
                placeholder={t[lang].suggestionsPlaceholder}
                value={formData.suggestions}
                onChange={handleChange}
              />
            </FormGroup>

            <Button color="primary" type="submit" disabled={submitted}>
              {t[lang].submit}
            </Button>
          </Form>
        </Col>
      </Row>
    </Container>
  );
};

export default Feed;
